import React, { useEffect } from 'react';
import Grid from '@material-ui/core/Grid';
import TypeBar from '../components/TypeBar';
import DeviceContainer from '../components/DeviceContainer';
import { RootStateType } from '../store/store';
import { getDevices } from '../action/deviceAction';
import { connect } from 'react-redux';

//типизация--------------------------------
type MapStateToPropsType = {};
type MapDispathPropsType = {
  getDevices: (
    typeId: string | null,
    brandId: string | null,
    limit: number,
    currentPage: number | null
  ) => void;
};
type PropsType = MapDispathPropsType & MapStateToPropsType;
//-----------------------------------------

const Content: React.FC<PropsType> = ({ getDevices }) => {
  useEffect(() => {
    getDevices('616c6c656a37991eed102c30', null, 5, 1);

    // eslint-disable-next-line
  }, []);
  return (
    <Grid item container>
      <TypeBar />
      <DeviceContainer />
    </Grid>
  );
};
const mapStateToProps = (state: RootStateType): MapStateToPropsType => {
  return {};
};
export default connect<
  MapStateToPropsType,
  MapDispathPropsType,
  unknown, // личные пропсы
  RootStateType
>(mapStateToProps, { getDevices })(Content);
